import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';

function Menu() {
  const session = JSON.parse(localStorage.getItem("session"));

  function CerrarSesion() {
    localStorage.clear()
    window.location.href = "/iniciarsesion"
  }

  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="/">
          <img alt="" src="data:image/png;base64," width="30" height="30" className="d-inline-block align-top" />{' '}
          Inicio</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="/team">Equipos</Nav.Link>
          <Nav.Link href="/match">Juegos</Nav.Link>
          <Nav.Link href="/standing">Posiciones</Nav.Link>          
        </Nav>
        <Navbar.Collapse className="justify-content-end">
        <Navbar.Text>Usuario: {session.email}</Navbar.Text>
          <Button variant="dark" onClick={() => CerrarSesion()}>Cerrar Sesi√≥n</Button>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Menu;
